	This necklace comes with a silver tone chain that is 18&#8221; in length and is perfect for gifting&#8230;

	proud member of <span class="caps">EFA</span>, SoCal Artisans, Victorian/Vintage EtsyU, and Old World Shoppes&#8230;

	Every necklace comes packaged in a beautiful italian gift box threaded with ribbon! (so if you are giving these as a gift&#8230;rest assured! They already come beautifully packaged! If they&#8217;re for yourself, it&#8217;s like receiving a special gift in the mail!) :)
